import "./App.css";

function App() {
  return (
    <>
      <div className="nav">
        <ul>
          <li className="home">#home</li>
          <li className="home">#about</li>
          <li className="home">#contact</li>
          <li className="home">#services</li>
          <p>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. In iure
            magnam impedit corporis blanditiis laboriosam enim illo, sapiente,
            perferendis possimus voluptatibus eaque est sed unde temporibus!
            Autem cupiditate exercitationem omnis!
          </p>
        </ul>
      </div>
    </>
  );
}

export default App;
